INSERT INTO `wp_posts` VALUES (1,1,'2019-02-10 13:49:15','2019-02-10 13:49:15','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world','','','2019-02-10 13:49:15','2019-02-10 13:49:15','',0,'http://wpproject.test/?p=1',0,'post','',1),(2,1,'2019-02-10 13:49:15','2019-02-10 13:49:15','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://wpproject.test/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','open','','sample-page','','','2019-02-10 13:49:15','2019-02-10 13:49:15','',0,'http://wpproject.test/?page_id=2',0,'page','',0),(3,1,'2019-02-10 13:49:15','2019-02-10 13:49:15','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://wpproject.test.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2019-02-10 13:49:15','2019-02-10 13:49:15','',0,'http://wpproject.test/?page_id=3',0,'page','',0),(5,1,'2019-02-13 02:57:47','2019-02-13 02:57:47','<!-- wp:paragraph -->\n<p>Guidelines on creating custom post types.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Create the definition of the post type in a plugin</li><li>Namespace the plugin, e.g., with a wgc_ prefix</li><li></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Here is some example code:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>function create_post_type() {\n  register_post_type( \'acme_product\',\n    array(\n      \'labels\' => array(\n        \'name\' => __( \'Products\' ),\n        \'singular_name\' => __( \'Product\' )\n      ),\n      \'public\' => true,\n      \'has_archive\' => true,\n    )\n  );\n}\nadd_action( \'init\', \'create_post_type\' );\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>Created a plugin and have some post types!  Now need to be able to query these. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>query GET_POSTS {\n  posts {\n    postTypeInfo {\n      name\n    }\n    edges {\n      node {\n        id\n        title\n        date\n        content\n        author {\n          name\n          lastName\n          username\n        }\n      }\n    }\n  }\n}</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>And similarly for resources:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>query GET_POSTS {\n  resources (first: 100) {\n    postTypeInfo {\n      name\n    }\n    edges {\n      node {\n        id\n        title\n        date\n        content\n        author {\n          name\n          lastName\n          username\n        }\n      }\n    }\n  }\n}</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>Now, let\'s work on assignments and allocations.   Assignments will have a project and a resource reference.   I don\'t think they need titles?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So, I\'ve created the advanced custom fields, and added resolvers for the fields. The query is working, but the values coming back are not correct.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>query GET_POSTS {\n  allocations (first: 100) {\n    postTypeInfo {\n      name\n    }\n    edges {\n      node {\n        id\n        title\n        date\n        content\n        author {\n          name\n          lastName\n          username\n        }\n        project\n        resource\n        hours\n      }\n    }\n  }\n}\n\nUPDATED HERE:\n\nquery GET_POSTS {\n  allocations (first: 100) {\n    postTypeInfo {\n      name\n    }\n    edges {\n      node {\n        id\n        title\n        date\n        content\n        author {\n          \n          lastName\n          username\n        }\n        project {\n          title\n        }\n        resource {\n          title\n        }\n        hours\n      }\n    }\n  }\n}\n\n</code></pre>\n<!-- /wp:code -->','Construction Notes','','publish','open','open','','first-post','','','2019-02-15 23:55:20','2019-02-15 23:55:20','',0,'http://wpproject.test/?p=5',0,'post','',0),(6,1,'2019-02-13 02:57:11','2019-02-13 02:57:11','','us carbon emissions','','inherit','open','closed','','us-carbon-emissions','','','2019-02-13 02:57:11','2019-02-13 02:57:11','',5,'http://wpproject.test/wp-content/uploads/2019/02/us-carbon-emissions.jpg',0,'attachment','image/jpeg',0),(7,1,'2019-02-13 02:57:47','2019-02-13 02:57:47','<!-- wp:paragraph -->\n<p>This is my first post</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":6} -->\n<figure class=\"wp-block-image\"><img src=\"http://wpproject.test/wp-content/uploads/2019/02/us-carbon-emissions.jpg\" alt=\"\" class=\"wp-image-6\"/><figcaption>Caption is here</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','First Post','','inherit','closed','closed','','5-revision-v1','','','2019-02-13 02:57:47','2019-02-13 02:57:47','',5,'http://wpproject.test/2019/02/13/5-revision-v1/',0,'revision','',0),(9,1,'2019-02-13 03:15:54','2019-02-13 03:15:54','<!-- wp:paragraph -->\n<p>Guidelines on creating custom post types.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Create the definition of the post type in a plugin</li><li>Namespace the plugin, e.g., with a wgc_ prefix</li><li></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Here is some example code:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>function create_post_type() {\n  register_post_type( \'acme_product\',\n    array(\n      \'labels\' => array(\n        \'name\' => __( \'Products\' ),\n        \'singular_name\' => __( \'Product\' )\n      ),\n      \'public\' => true,\n      \'has_archive\' => true,\n    )\n  );\n}\nadd_action( \'init\', \'create_post_type\' );\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>...</p>\n<!-- /wp:paragraph -->','Instructions','','inherit','closed','closed','','5-revision-v1','','','2019-02-13 03:15:54','2019-02-13 03:15:54','',5,'http://wpproject.test/2019/02/13/5-revision-v1/',0,'revision','',0),(11,1,'2019-02-13 03:16:50','2019-02-13 03:16:50','<!-- wp:paragraph -->\n<p>Guidelines on creating custom post types.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Create the definition of the post type in a plugin</li><li>Namespace the plugin, e.g., with a wgc_ prefix</li><li></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Here is some example code:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>function create_post_type() {\n  register_post_type( \'acme_product\',\n    array(\n      \'labels\' => array(\n        \'name\' => __( \'Products\' ),\n        \'singular_name\' => __( \'Product\' )\n      ),\n      \'public\' => true,\n      \'has_archive\' => true,\n    )\n  );\n}\nadd_action( \'init\', \'create_post_type\' );\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>Next: Get some general instructions on creating a simple WP plugin</p>\n<!-- /wp:paragraph -->','Instructions','','inherit','closed','closed','','5-revision-v1','','','2019-02-13 03:16:50','2019-02-13 03:16:50','',5,'http://wpproject.test/2019/02/13/5-revision-v1/',0,'revision','',0),(57,1,'2019-02-14 01:37:43','2019-02-14 01:37:43','','CD Custom Modules and Plugins','','publish','clo