li><li>Namespace the plugin, e.g., with a wgc_ prefix</li><li></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Here is some example code:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>function create_post_type() {\n  register_post_type( \'acme_product\',\n    array(\n      \'labels\' => array(\n        \'name\' => __( \'Products\' ),\n        \'singular_name\' => __( \'Product\' )\n      ),\n      \'public\' => true,\n      \'has_archive\' => true,\n    )\n  );\n}\nadd_action( \'init\', \'create_post_type\' );\n</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>Created a plugin and have some post types!  Now need to be able to query these. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>query GET_POSTS {\n  posts {\n    postTypeInfo {\n      name\n    }\n    edges {\n      node {\n        id\n        title\n        date\n        content\n        author {\n          name\n          lastName\n          username\n        }\n      }\n    }\n  }\n}</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>And similarly for resources:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>query GET_POSTS {\n  resources (first: 100) {\n    postTypeInfo {\n      name\n    }\n    edges {\n      node {\n        id\n        title\n        date\n        content\n        author {\n          name\n          lastName\n          username\n        }\n      }\n    }\n  }\n}</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:paragraph -->\n<p>Now, let\'s work on assignments and allocations.   Assignments will have a project and a resource reference.   I don\'t think they need titles?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So, I\'ve created the advanced custom fields, and added resolvers for the fields. The query is working, but the values coming back are not correct.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>query GET_POSTS {\n  allocations (first: 100) {\n    postTypeInfo {\n      name\n    }\n    edges {\n      node {\n        id\n        title\n        date\n        content\n        author {\n          name\n          lastName\n          username\n        }\n        project\n        resource\n        hours\n      }\n    }\n  }\n}\n\nUPDATED HERE:\n\nquery GET_POSTS {\n  allocations (first: 100) {\n    postTypeInfo {\n      name\n    }\n    edges {\n      node {\n        id\n        title\n        date\n        content\n        author {\n          \n          lastName\n          username\n        }\n        project {\n          title\n        }\n        resource {\n          title\n        }\n        hours\n      }\n    }\n  }\n}\n\n</code></pre>\n<!-- /wp:code -->','Construction Notes','','inherit','closed','closed','','5-revision-v1','','','2019-02-15 23:55:20','2019-02-15 23:55:20','',5,'http://wpproject.test/2019/02/15/5-revision-v1/',0,'revision','',0),(117,1,'2019-02-17 20:46:02','2019-02-17 20:46:02','<!-- wp:heading -->\n<h2>Tips for Using Reach</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>How can bookmark my assignments?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Bookmark your assignments by appending #Name to the /resources link like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>https://live-cu-reach.pantheonsite.io/resources#Rich/</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Who can edit assignments?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Users with the \"editor\" or \"administrator\" role can edit projects, resources and assignments.   Other users who have accounts on Reach will see the data in read-only mode.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>How can I view person totals?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The person totals in Reach are\nnow displayed inline on the Projects page; notice there is a Totals button between\neach project to open the Totals display. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Totals section will close\nif you click the Close button at the bottom of the Totals grid, or if you open Totals\nsomewhere else, or if you update some project data (because then the totals may\nno longer be valid). &nbsp;Each time you open\nTotals, it is recalculated. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The names in the Totals are\nhot linked to that persons schedule, which will open in a new, named tab/window.\n</p>\n<!-- /wp:paragraph -->','FAQs','','publish','closed','closed','','help','','','2019-03-08 02:13:16','2019-03-08 02:13:16','',0,'http://wpproject.test/?page_id=117',0,'page','',0),(118,1,'2019-02-17 20:46:02','2019-02-17 20:46:02','<!-- wp:paragraph -->\n<p>This will be the Help page for Resource Manager.</p>\n<!-- /wp:paragraph -->','Help','','inherit','closed','closed','','117-revision-v1','','','2019-02-17 20:46:02','2019-02-17 20:46:02','',117,'http://wpproject.test/2019/02/17/117-revision-v1/',0,'revision','',0),(119,1,'2019-02-17 20:46:30','2019-02-17 20:46:30',' ','','','publish','closed','closed','','119','','','2020-07-27 18:40:32','2020-07-27 18:40:32','',0,'http://wpproject.test/?p=119',12,'nav_menu_item','',0),(120,1,'2019-02-19 01:17:46','2019-02-19 01:17:46','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:11:\"wgc_project\";}}}s:8:\"position\";s:15:\"acf_after_title\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";a:8:{i:0;s:10:\"discussion\";i:1;s:8:\"comments\";i:2;s:9:\"revisions\";i:3;s:4:\"slug\";i:4;s:6:\"author\";i:5;s:6:\"format\";i:6;s:14:\"featured_image\";i:7;s:15:\"send-trackbacks\";}s:11:\"description\";s:0:\"\";}','Project Group','project-group','publish','closed','closed','','group_5c6b58952ac7