g -->\n\n<!-- wp:paragraph -->\n<p>Bookmark your assignments by appending #Name to the /resources link like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>https://live-cu-reach.pantheonsite.io/resources#Rich/</code></pre>\n<!-- /wp:code -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Who can edit assignments?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Users with the \"editor\" or \"administrator\" role can edit projects, resources and assignments.   Other users who have accounts on Reach will see the data in read-only mode.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>How can I view person totals?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The person totals in Reach are\nnow displayed inline on the Projects page; notice there is a Totals button between\neach project to open the Totals display. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The Totals section will close\nif you click the Close button at the bottom of the Totals grid, or if you open Totals\nsomewhere else, or if you update some project data (because then the totals may\nno longer be valid). &nbsp;Each time you open\nTotals, it is recalculated. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The names in the Totals are\nhot linked to that persons schedule, which will open in a new, named tab/window.\n</p>\n<!-- /wp:paragraph -->','FAQs','','inherit','closed','closed','','117-revision-v1','','','2019-03-08 02:13:15','2019-03-08 02:13:15','',117,'http://live-cu-reach.pantheonsite.io/2019/03/08/117-revision-v1/',0,'revision','',0),(259,4,'2019-03-24 23:42:04','2019-03-24 23:42:04','','Eric - Developer','','publish','closed','closed','','eric-developer','','','2019-03-24 23:42:18','2019-03-24 23:42:18','',0,'https://live-cu-reach.pantheonsite.io/?post_type=wgc_resource&#038;p=259',0,'wgc_resource','',0),(280,4,'2019-05-23 14:35:53','2019-05-23 14:35:53','','Hank - WA','','publish','closed','clos